import React from 'react';

function Announcements() {
  return (
    <div>
      <h1>Announcements</h1>
      <ul>
      <ul>
        <li>Welcome to Technology Class</li>
        <li>I look forward to working with you all!</li>
      </ul>
        {/* Add more announcements as needed */}
      </ul>
    </div>
  );
}

export default Announcements;
